import './UserSelection.css';
import { Link } from 'react-router-dom'

function UserSelection({ cas }) {
    if (cas === "mock") {
        return (
            <div>
                <h2>Selection du profil</h2>
                <nav>
                    <Link className='main-nav' to="/">Karl mocked</Link>
                    <Link className='main-nav' to="/profil">Cecilia mocked</Link>
                </nav>
            </div>

        );
    } else {
        return (
            <div>
                <h2>Selection du profil</h2>
                <nav>
                    <Link className='main-nav' to="/">Karl API</Link>
                    <Link className='main-nav' to="/profil">Cecilia API</Link>
                </nav>
            </div>

        );
    }
}

export default UserSelection;
